import { __makeTemplateObject } from "tslib";

export class Inquiry {
    Id?:number;
    Name?:string;
    Phone?:string;
    Email?:string;
    ProductId?:number;  
    Price?:number;
    UserId?:number;

    constructor(id?:number, name?:string, phone?:string, email?:string, productId?:number, price?:number,userid?:number){
        this.Id=id;
        this.Name=name;
        this.Phone=phone;
        this.Email=email;
        this.ProductId=productId;
        this.Price=price;
        this.UserId=userid;

    }
}
